import React from 'react';
import bg_img from '../src/Images/development1.png'
import Common from './Common';
const Service = () =>{
    return(
        <>
        <Common 
                heading_name="Welcome to about page"
                btn_text="contact us"
                visit="/service"
                imgsrc={bg_img}
            />
        </>
    );
}

export default Service;
